import React, { Component } from 'react';
import AltHeader from '../1-Header/AltHeader';

class KitapKayit extends Component {
    render() {
        return (
            <div>
                          <h1>    KitapKayıt Sayfasındasınız.        </h1>

                          <AltHeader></AltHeader>
            </div>
           
        )
    }
}
export default KitapKayit;
